class ListSort {
    list: Array<number | string>
    constructor(list: Array<number | string>) {
        this.list = list
    }

    BubbleSort(): Array<number | string> {
        let change: boolean
        do {
            change = false
            for (let index = 0; index < this.list.length - 1; index++) {

                if (this.list[index] > this.list[index + 1]) {
                    [this.list[index], this.list[index + 1]] = [this.list[index + 1], this.list[index]]
                    change = true
                }
            }

        } while (change)
        return this.list
    }
    MergSort() {
        function mergesort(arr: Array<number | string>): Array<number | string> {

            if (arr.length <= 1) {
                return arr
            }
            let mid = Math.floor(arr.length / 2)
            let front = arr.slice(0, mid)
            let back = arr.slice(mid)
            front = mergesort(front)
            back = mergesort(back)
            return merge(front, back)
        }
        function merge(front: Array<number | string>, back: Array<number | string>): Array<number | string> {
            let result: Array<number | string> = []
            while (front.length > 0 && back.length > 0) {
                if (front[0] <= back[0]) {

                    result.push(front.shift()!)

                }
                else {
                    result.push(back.shift()!)

                }
            }
            result.push(...front)
            result.push(...back)

            return result
        }

        this.list = mergesort(this.list)
        return this.list

    }
    HeapSort(): Array<number | string> {
        function heapsort(list: Array<number | string>): Array<number | string> {
            let n: number = list.length
            for (let index = (Math.floor(n / 2) - 1); index >= 0; index--) {
                heapafy(list, n, index)
            }
            for (let index = n - 1; index >= 0; index--) {
                let value = list[0]
                let value1 = list[index]
                list[0] = value1
                list[index] = value
                heapafy(list, index, 0)
            }
            return list
        }
        function heapafy(list: Array<number | string>, n: number, i: number): Array<number | string> {
            let largest = i
            let left = 2 * i + 1
            let right = 2 * i + 2
            if (left < n && list[left] > list[largest]) {
                largest = left
            }
            if (right < n && list[right] > list[largest]) {
                largest = right
            }
            if (largest !== i) {
                let value = list[largest]
                let value1 = list[i]
                list[largest] = value1
                list[i] = value
                heapafy(list, n, largest)
            }

            return list
        }
        heapsort(this.list)
        return this.list
    }
}



